import React, { useState } from 'react';
import PersonalInfo from './components/PersonalInfo';
import Address from './components/Address';
import EducationalInfo from './components/EducationalInfo';
import './App.css'

const App = () => {
  const [personalInfo, setPersonalInfo] = useState(null);
  const [addressInfo, setAddressInfo] = useState(null);
  const [educationalInfo, setEducationalInfo] = useState(null);

  const handlePersonalInfoSubmit = (data) => {
    // Make a POST request to your backend endpoint
    axios.post('/api/personalInfo', data)
      .then(response => {
        console.log('PersonalInfo submitted successfully');
      })
      .catch(error => {
        console.error('Error submitting PersonalInfo:', error);
      });
  };


  const handleAddressSubmit = (data) => {
    // Make a POST request to your backend endpoint
    axios.post('/api/address', data)
      .then(response => {
        console.log('Address information submitted successfully');
      })
      .catch(error => {
        console.error('Error submitting Address information:', error);
      });
  };

  const handleEducationalInfoSubmit = (data) => {
    // Make a POST request to your backend endpoint
    axios.post('/api/educationalInfo', data)
      .then(response => {
        console.log('EducationalInfo submitted successfully');
      })
      .catch(error => {
        console.error('Error submitting EducationalInfo:', error);
      });
    };
  return (
    <div className="App">
      <PersonalInfo onSubmit={handlePersonalInfoSubmit} />

      <Address onSubmit={handleAddressSubmit} />

      <EducationalInfo onSubmit={handleEducationalInfoSubmit} />
    </div>
  );
};

export default App;
